// Meme Class
class Meme {
    constructor(url, id, width, height, name, boxCount, inputBoxes) {
      this.url = url;
      this.id = id;
      this.width = width;
      this.height = height;
      this.name = name;
      this.boxCount = boxCount;
      this.inputBoxes = inputBoxes;
    }
  }

  export default Meme